import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the sort filter appear, we first need to perform a search.
    // 1. Fill the search input
    const searchInput = page.locator('#searchInput');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.fill('electronics');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // 2. Click the search button
    const searchButton = page.locator('button.search-btn').first();
    await searchButton.click();

    // 3. Wait for the results page and the sort dropdown to be visible
    const sortSelect = page.locator('#sortSelect');
    await sortSelect.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 4. Apply the price sort filter (High to Low)
    await sortSelect.selectOption({ value: 'price-high' });

    // 5. Take a screenshot after applying the filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_price_sorted.png'));

    // 6. Extract the current value of the sort dropdown to verify
    const selectedSortValue = await sortSelect.inputValue();

    return {
      success: true,
      action: "Applied 'Price: High to Low' sort filter after searching for 'electronics'.",
      extractedData: {
        selectedSort: selectedSortValue,
        expectedSort: 'price-high'
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error if possible
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      screenshots.push(errorScreenshotPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to apply price sort filter.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
